import React from 'react';
import './Home.css';

const Home = () => {
  return (
    <div className="home">
      <h1>Добро пожаловать в Практику Маршрутизации</h1>
      <p>Выберите раздел в меню навигации.</p>
    </div>
  );
};

export default Home;
